const bg = require("heatshrink").decompress(atob(""));

const locale = require("locale");

const COLORS = {
  blue: '#0000ff',
  green: '#00ff00',
  red: '#ff0000',
  white: '#ffffff',
  black: '#000000',
  yellow: '#ffff00',
  gold: '#801000'
};

const SETTINGS = {
  colors: {
    date: COLORS.white,
    time: COLORS.green,
    compass: COLORS.gold,
    steps: COLORS.gold
  }
};

function drawBounds(x, y, w, h, c) {
  var color = g.getColor();
  //g.clearRect(x, y, w, h);
  g.setColor(c);
  g.drawRect(x, y, w, h);
  g.setColor(color);
}

function drawDOW(str, x, y, w, h) {
  let xoff = Math.floor((w - g.stringWidth(str)) / 2);
  let yoff = Math.floor((h - g.getFontHeight()) / 2);
  g.drawString(str, x + xoff, y + yoff);
}

function drawMonth(str, x, y, w, h) {
  let xoff = Math.floor((w - g.stringWidth(str)) / 2);
  let yoff = Math.floor((h - g.getFontHeight()) / 2);
  g.drawString(str, x + xoff, y + yoff);
}

function drawDayAndYear(str, x, y, w, h) {
  let xoff = Math.floor((w - g.stringWidth(str)) / 2);
  let yoff = Math.floor((h - g.getFontHeight()) / 2);
  g.drawString(str, x + xoff, y + yoff);
}

function drawDate(x, y, w, h) {
  //g.clearRect(x, y, w, h);
  //drawBounds(x, y, w, h, COLORS.blue);
  var font = g.getFont();
  g.setFont("Vector18");
  var color = g.getColor();
  g.setColor(SETTINGS.colors.date);
  const now = new Date();
  let height = Math.floor(h / 3);
  drawDOW(locale.dow(now), x, y, w, height);
  drawMonth(locale.month(now), x, y + height, w, height);
  drawDayAndYear(now.getDate() + " " + now.getFullYear(), x, y + (height * 2), w, height);
  g.setColor(color);
  g.setFont(font);
}

function drawTime(x, y, w, h) {
  function getTmStr() {
    const is12Hour = (require("Storage").readJSON("setting.json", 1) || {})["12hour"];

    function getHours(now) {
      if (!is12Hour)
        return now.getHours();
      if (!now.getHours())
        return 12;
      return now.getHours() - (now.getHours() > 12 ? 12 : 0);
    }
    var now = new Date();
    var hr = getHours(now),
      m = now.getMinutes();
    return hr + ":" + m.toString().padStart(2, 0);
  }

  function getTmXOff(timestr) {
    const longest = g.stringWidth("00:00");
    const cur = g.stringWidth(timestr);
    return Math.floor((w - longest) / 2) + (longest - cur);
  }

  function getTmYOff(timestr) {
    return Math.floor((h - g.getFontHeight()) / 2);
  }

  function setMaxTmFont() {
    var i = 35;
    for (; i > 15; i--) {
      g.setFont("Vector" + i);
      if (g.stringWidth("00:00") < w - 1)
        break;
    }
    return "Vector" + i;
  }

  //g.clearRect(x, y, w, h);

  var time = getTmStr();
  var font = g.getFont();
  setMaxTmFont();
  var color = g.getColor();
  g.setColor(SETTINGS.colors.time);
  g.drawString(time, x + getTmXOff(time), y + getTmYOff(time));
  g.setColor(color);
  g.setFont(font);
}

